export const fetchData = async () => {
  try {
    const response = await fetch("https://jsonplaceholder.typicode.com/posts");
    const data = await response.json();
    data = data.stringify()
    console.log(data)
    return data;
  } catch (e) {
    console.log(e);
  }
};
